import './App.css';
import { Route, Routes, Link } from 'react-router';
import Home from './pages/Home';
import Login from './pages/Login';

function App() {
  return (
    <Routes>
      <Route exact path='/' element={<Home></Home>} />
      <Route exact path='/login' element={Login} />
    </Routes>
  );
}

export default App;
